Consider the following: #[derive(PartialEq, PartialEqRef)]
enum Token { Add, Num(i64), Str(String)
} #[derive(Parser)]
#[parser(Token, Token)]
enum Expr { #[parser([[@Expr]], Token::Add, [[@Expr]])] Add { left: Box<Self>, right: Box<Self> }, #[parser([@ExprLit])] Literal(ExprLit)
} #[derive(Parser)]
#[parser(Token, Token)]
enum ExprLit { #[parser([Token::Num(t)])] Number(i64), #[parser([Token::Str(t)])] String(String)
} This can lead to zero-consumption branching if we call Expr::parse, so-called because it consumes zero elements in src and branches the program. This is because it will try to first parse an Expr, leading to it trying to parse an Expr etc. resulting in a stack overflow. To prevent this we instead call Parser::parse_with_recursion(src, false) which is expected to prevent this call from trying to parse itself again. This should not prevent calling Parser::parse for Self once something has been consumed. If this is in your code, you will need to ensure that C: Default. This can be done for an enum by re-using one of the variants, since this is only required to have some value returned to prevent a stack overflow. See example 3 for an example of this.

