Consider the following rule from the first example : #[derive(Parser)]
#[parser( Token, Token; ([@Value])+, [@Sep], ([@Value])*, (@Sep)?)
]
pub struct Base { first: Vec<Value>, sep: Sep, last: Vec<Value>
} The first line in the helper attribute (line 3) is the metadata. The line after defines the rule for the parser impl. We'll consider this in segments: ([@Value])+ Firstly, @Value is a call to another rule, Value in this case. This will try to parse a Value type. Placing square brackets around this means that we save the match. The parentheses makes it a group and the + makes the group into a positive closure, meaning we match at least one Value [@Sep] This saves a Sep type that's matched the input ([@Value])* This is the same as ([@Value])+ but for a kleene closure, meaning we match zero or more Value types (@Sep)? @Sep will match a Sep type. The ? after the group means that this is optional, so it can either be matched or not When saving values, you might need to box a value to ensure that the type has a known size at compile time. If this is required, you can use two square brackets to indicate as such. For example, [[@Sep]] would match a Sep type and box the result (Box<Sep>)

