pub trait Parser<I, C, R = Self> where I: PartialEq<C>, C: PartialEq<C>
{ fn parse<T>(src: &mut T) -> Result<R, Error<I, C>> where I: Iterator<Item=I> + Clone, Self: Sized;
} When deriving the Parser trait, you will need to ensure that your input type I implements PartialEq<C> where C is your comparison type (this will make sense the more you read). You will also need to ensure that C: PartialEq<C>. IMPORTANT: If the input and comparison types are given as the same thing, deriving PartialEq on the input type will not cover the requirement I: PartialEq<C>. Since the input comes from an iterator, I will be a reference. If the input and comparison types are given as the same, then I = &C. In this case, you will need to impl &C: PartialEq<C>. You can use the PartiqlEqRef derive macro to derive a simple impl for this: impl PartialEq<C> for &C { fn eq(&self, other: &C) -> bool { self == other }
}

